import React, { useState,useEffect } from "react"
import "react-widgets/styles.css"; 
import Combobox from "react-widgets/Combobox";
import axios from 'axios';


function SellingInputForm(props){

    const location = props.location
    const[neighborhood, setNeighborhood]=useState([]);
    const[municipality, setMunicipality] = useState('');
    const roomCount=['1.0', '1.5', '2.0', '2.5', '3.0', '3.5', '4.0', '4.5', '5.0'];
    const heatingType=["Etažno", "Centralno", "Struja", "Gas", "TA peć", "Klima", "Podno", "Norveški radijatori", "Bez grejanja"] 
    const [price, setPrice] = useState(0);
    const [checkedElevator, setCheckedElevator] = useState(false);
    const [checkedRegistered, setCheckedRegistered] = useState(false);
    const [checkedLastFloor, setCheckedLastFloor] = useState(false);
    const [showForm, setShowForm] = useState(false);

    const initRealEstateData = {
        municipality:'',
        neighborhood:'',
        quadrature:'',
        roomCount:'',
        floor:'',
        heatingType:'',
        hasElevator:false,
        registeredStatus: false,
        isLastFloor: false
    }

    const [realEstateData, setRealEstateData] = useState(initRealEstateData);

    function handleInput(e){
        let inputData = realEstateData;
        inputData[e.target.name]=e.target.value;
        setRealEstateData(inputData);
        console.log(e.target.value)
    }

    const fetchData = async () => {
        let res = await axios.get('https://localhost:44338/api/Mapper/'+location);
        realEstateData['municipality']=res.data.location;
        setMunicipality(res.data.location);
        setNeighborhood(res.data.neighborhoods);
        setRealEstateData({ ...initRealEstateData, municipality: res.data.location });
        console.log(realEstateData)
    }

    function calculatePrice (e){
        console.log(realEstateData)
		e.preventDefault();
        axios.post('https://localhost:44338/api/PriceAnalyser/calculate', realEstateData)
            .then((res)=>{
                console.log(res.data);
                setPrice(res.data);
            });
    }
    
    useEffect(() => {
        console.log("Loading")
        if(props.location){
            fetchData();
        }
    },[props.location]);


   

    return(
        <div>
            <form>
                <h2>Unesite podatke o nekretnini</h2>
                <div>
                <label>Opština</label>
                    <input
                        type="text"
                        placeholder="Opština"
                        name="municipality"
                        disabled='true'
                        value={municipality}
                        className="inputField"
                        required = 'true'
                        onChange={setShowForm(true)}
                    ></input>
                </div>
                {showForm===false ? null : <div>
                <div>
                    <label>Naselje</label>
                    <Combobox
                        defaultValue=""
                        data={neighborhood}
                        placeholder="Izaberite naselje"
                        style={{ marginBottom: 20 }}
                        aria-required='true'
                        value={realEstateData.neighborhood} 
                        onChange={(value) => setRealEstateData({ ...realEstateData, neighborhood: value })}
                        />
                </div>
                <div>
                    <label>Kvadratura</label>
                    <input
                        type="text"
                        placeholder="m2"
                        name="quadrature"
                        onInput={handleInput}
                        className="inputField"
                        required = 'true'
                    ></input>
                </div>
                <div>
                    <label>Broj soba</label>
                    <Combobox
                        defaultValue=""
                        data={roomCount}
                        placeholder="Izaberite broj soba"
                        onChange={value=>realEstateData.roomCount=value}
                        style={{marginBottom:20}}
                        aria-required = 'true'
                    />
                </div>
                <div>
                    <label>Sprat</label>
                    <input
                        type="text"
                        name="floor"
                        onInput={handleInput}
                        className="inputField"
                        required = 'true'
                    ></input>
                </div>
                <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedLastFloor ? "checkedHistoricalData":""} checked={checkedLastFloor} onChange={()=>{setCheckedLastFloor(!checkedLastFloor); realEstateData['isLastFloor']=!checkedLastFloor}}></input>
              <label htmlFor='checkedDomacin'>Stan na poslednjem spratu</label>
              </div>
                <div>
                    <label>Grejanje</label>
                    <Combobox
                        defaultValue=""
                        data={heatingType}
                        placeholder="Izaberite tip grejanja"
                        onChange={value=>realEstateData.heatingType=value}
                        style={{marginBottom:20}}
                        aria-required = 'true'
                    />
                </div>
                <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedElevator ? "checkedHistoricalData":""} checked={checkedElevator} onChange={()=>{setCheckedElevator(!checkedElevator); realEstateData['hasElevator']=!checkedElevator}}></input>
              <label htmlFor='checkedDomacin'>Zgrada sa liftom</label>
              </div>
              <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedRegistered ? "checkedHistoricalData":""} checked={checkedRegistered} onChange={()=>{setCheckedRegistered(!checkedRegistered); realEstateData['registeredStatus']=!checkedRegistered}}></input>
              <label htmlFor='checkedDomacin'>Registrovan stan</label>
              </div>
           
                <div>
                    <button onClick={calculatePrice} className="btnCalculate">
                        Izračunaj cenu
                    </button>
                </div>
                <div>
                    <h3>{price!==0 ? <>Procenjena cena nekretnine je {price}€.</> : null}</h3>
                </div>
            </div> } 
            </form>
        </div>
    )

}

export default SellingInputForm;
